## 7. Acknowledgments

The data products used for this paper have been collected from various sources:

- the Global PALSAR-2/PALSAR/IERS-1 Mosaics and Forest/Non-Forest Maps of the Japan Aerospace Exploration Agency;
- the ALOS Global Digital Surface Model "ALOS World 3D - 30m (AW3D30)" of the Japan Aerospace Exploration Agency;
- the Land Cover 2019 (v3) of the European Union's Copernicus Land Monitoring Service;
- the Sentinel-2 L1C products, courtesy of Copernicus, downloaded via the French PEPS platform;
- the GEDI L4A product, courtesy of the NASA GEDI Team, downloaded from Oak Ridge National Laboratory DAAC.

We thank them for making this data openly available for academic purposes.
